guageCode\":\"zu\",\"languageName\":{\"simpleText\":\"Zulu\"}}],\"defaultAudioTrackIndex\":0}},\"videoDetails\":{\"videoId\":\"mR6EMZYL9UM\",\"title\":\"Vasopressors (Part 1) - ICU Drips\",\"lengthSeconds\":\"1427\",\"keywords\":[\"icu drips\",\"critical care drips\",\"pressors in icu\",\"pressors used in icu\",\"icu drips made easy\",\"vasopressors in icu\",\"vasopressors icu\",\"vasopressors\",\"vasopressors chart\",\"icu vasoactive drips\",\"critical care vasopressors\",\"icu advantage\",\"icu\",\"vasopressors nursing\",\"vasopressor medications\",\"what are vasopressors\",\"critical care\",\"critical care nursing\",\"adrenergic receptors\",\"levophed\",\"norepinephrine\",\"neosynephrine\",\"phenylephrine\",\"vasopressin\",\"epinephrine\",\"dopamine\",\"vasopressors when to use\"],\"channelId\":\"UC5ADeLt8ckSBvfz0C47qbGQ\",\"isOwnerViewing\":false,\"shortDescription\":\"In this lesson, we start a new collection of lessons covering ICU drips, and specifically we start off talking about vasopressors.  This is going to be a two part lesson.  In this first part we start off talking about what vasopressors are and why they are used for our patients.  We then get in to the actions of vasopressors on various receptor sites and explain the differences between these receptors.\\n\\nFrom there we move on and cover the 6 main vasopressors and talk about the specific receptors in which they act as well as some useful information relating to dosing and onset of action. We finish out the lesson with a chart comparing these vasopressors in one spot so you can have a better understanding of these differences between each pressor.\\n\\nThe next part of this series we will be covering very important tidbits of information that come in to play when managing patients on these medication.\\n\\nOur hope is that by the end of this lesson you will have a better understanding of what pressors are as well as the differences between the main various vasopressors that we use.\\n\\nThank you guys so much for watching! Please leave us a like if you enjoyed the video. We truly do appreciate it! Also we love hearing your comments so feel free to tell us what you think of the video.\\n\\n-+-+-+-+-+-\\n\\nGear That We Use To Make These Videos\\n------------------------------------------------------------------\\nApple Pencil: https:\/\/amzn.to\/368qS83\\niPad Pro 12.9: https:\/\/amzn.to\/367s2QV\\nBlue Yeti Mic: https:\/\/amzn.to\/2Q7vrK9\\nMacBook Pro 15: https:\/\/amzn.to\/2tcDegM\\n\\nBooks We Recommend\\n-------------------------------------\\nBarrons CCRN Exam: https:\/\/amzn.to\/2MFWIkH\\nPass CCRN!: https:\/\/amzn.to\/36apxgN\\nAACN Essentials of Critical Care Nursing: https:\/\/amzn.to\/2F5riQs\\nKaplan Adult CCRN Review: https:\/\/amzn.to\/37igv1t\\nMarinos The ICU Book: https:\/\/amzn.to\/2ZzKP4Y\\n\\nSome of Our Favorite Nursing Gear\\n--------------------------------------------------------\\n3M Littmann Master Cardiology Stethoscope: https:\/\/amzn.to\/2sn0wR5\\nRip Shears - Trauma Shears: https:\/\/amzn.to\/35diZwR\\nLeatherman - Raptor Shears: https:\/\/amzn.to\/2MGF801\\nStethoscope Tape Holder: https:\/\/amzn.to\/2snWkAy\\nPilot FriXion Erasable Pens: https:\/\/amzn.to\/2Qw9pQg\\nApple Watch: https:\/\/amzn.to\/356wKgF\\nApple Watch Sport Band: https:\/\/amzn.to\/37lroQ0\\nTakeya Vacuum Stainless Water Bottle: https:\/\/amzn.to\/37lqIKq\\n\\n+-+-+-+-+-\\n\\nPlease if you enjoyed this video or found it useful, hit the like button as this greatly helps our channel out!\\n\\nAlso make sure and subscribe and hit the bell icon and select all notifications to stay up to date on our latest videos!\\n\\nFinally make sure to make your way over to our Facebook \\u0026 Instagram pages and give us a like and shout out over there!\\n\\nhttps:\/\/www.facebook.com\/icuadvantage\\nhttps:\/\/www.instagram.com\/icuadvantage\\n\\n-+-+-+-+-+-\\n\\nDon't forget to check out the playlist for this series of lessons here:\\n\\nAlso check out these other great less r our patients.  We then get in to the actions of vasopressors on various receptor sites and explain the differences between these receptors.\\n\\nFrom there we move on and cover the 6 main vasopressors and talk about the specific receptors in which they act as well as some useful information relating to dosing and onset of action. We finish out the lesson with a chart comparing these vasopressors in one spot so you can have a better understanding of these differences between each pressor.\\n\\nThe next part of this series we will be covering very important tidbits of information that come in to play when managing patients on these medication.\\n\\nOur hope is that by the end of this lesson you will have a better understanding of what pressors are as well as the differences between the main various vasopressors that we use.\\n\\nThank you guys so much for watching! Please leave us a like if you enjoyed the video. We truly do appreciate it! Also we love hearing your comments so feel free to tell us what you think of the video.\\n\\n-+-+-+-+-+-\\n\\nGear That We Use To Make These Videos\\n------------------------------------------------------------------\\nApple Pencil: https:\/\/amzn.to\/368qS83\\niPad Pro 12.9: https:\/\/amzn.to\/367s2QV\\nBlue Yeti Mic: https:\/\/amzn.to\/2Q7vrK9\\nMacBook Pro 15: https:\/\/amzn.to\/2tcDegM\\n\\nBooks We Recommend\\n-------------------------------------\\nBarrons CCRN Exam: https:\/\/amzn.to\/2MFWIkH\\nPass CCRN!: https:\/\/amzn.to\/36apxgN\\nAACN Essentials of Critical Care Nursing: https:\/\/amzn.to\/2F5riQs\\nKaplan Adult CCRN Review: https:\/\/amzn.to\/37igv1t\\nMarinos The ICU Book: https:\/\/amzn.to\/2ZzKP4Y\\n\\nSome of Our Favorite Nursing Gear\\n--------------------------------------------------------\\n3M Littmann Master Cardiology Stethoscope: https:\/\/amzn.to\/2sn0wR5\\nRip Shears - Trauma Shears: https:\/\/amzn.to\/35diZwR\\nLeatherman - Raptor Shears: https:\/\/amzn.to\/2MGF801\\nStethoscope Tape Holder: https:\/\/amzn.to\/2snWkAy\\nPilot FriXion Erasable Pens: https:\/\/amzn.to\/2Qw9pQg\\nApple Watch: https:\/\/amzn.to\/356wKgF\\nApple Watch Sport Band: https:\/\/amzn.to\/37lroQ0\\nTakeya Vacuum Stainless Water Bottle: https:\/\/amzn.to\/37lqIKq\\n\\n+-+-+-+-+-\\n\\nPlease if you enjoyed this video or found it useful, hit the like button as this greatly helps our channel out!\\n\\nAlso make sure and subscribe and hit the bell icon and select all notifications to stay up to date on our latest videos!\\n\\nFinally make sure to make your way over to our Facebook \\u0026 Instagram pages and give us a like and shout out over there!\\n\\nhttps:\/\/www.facebook.com\/icuadvantage\\nhttps:\/\/www.instagram.com\/icuadvantage\\n\\n-+-+-+-+-+-\\n\\nDon't forget to check out the playlist for this series of lessons here:\\n\\nAlso check out these other great lessons and series of lessons below!\\n\\nHemodynamics Principals: https:\/\/www.youtube.com\/playlist?list=PL2oVjKTYocdMBZlcIcWlESbOFFaGugQS2\\nShock: https:\/\/www.youtube.com\/playlist?list=PL2oVjKTYocdPP0K8Fi49GfUgprICS-xMf\\nArterial Blood Gases: https:\/\/www.youtube.com\/playlist?list=PL2oVjKTYocdMz1qF-3iS6iUZ-R_fKbeJw\\nECG\/EKG Rhythm Interpretation: https:\/\/www.youtube.com\/playlist?list=PL2oVjKTYocdPMaNwn4xbg6xAIaAnyraMj\\nHeart Failure: https:\/\/www.youtube.com\/playlist?list=PL2oVjKTYocdNdFoS31yGhylKwib9lRf73\\nEndocrine System: https:\/\/www.youtube.com\/playlist?list=PL2oVjKTYocdO74cmXgmKjexoq59j93-Wv\\n\\nBlood Tubes - Order of Draw: https:\/\/youtu.be\/mAmwdDdbkUI\\nGlasgow Coma Scale: https:\/\/youtu.be\/zYwJVPIjW6I\\n\\n-+-+-+-+-+-\\n\\nTrack: whogaux - i don't care [NCS Release]\\nMusic provided by NoCopyrightSounds.\\nWatch: https:\/\/youtu.be\/qTG2KAiuoSA\\nFree Download \/ Stream: http:\/\/ncs.io\/idontcare\\n\\n-+-+-+-+-+-\\n\\nDISCLAIMER: Links included in this description are affiliate links. If you purchase a product or service with the links that I provide I may receive a small commission. There is no addi
